import React, { Component } from "react";
import CourseList from "../Components/CourseList";

class Courses extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <p>This is the Courses Page.</p>
        <CourseList />
      </div>
    );
  }
}

export default Courses;
